widget.on('domready', function(se, event){
	var nonHeader =	$('.table-grid__row:not(.table-grid__row-0)');
	var nonClickable = nonHeader.find('.table-grid__cell:nth-child(n+2)'); // starting from the 2nd column
	var clickable = nonHeader.find('.table-grid__cell:nth-child(-n+1)');
  nonClickable.css({'cursor':'default'});
  nonClickable.find('.table-grid__content').css({'color': 'inherit'});
  clickable.css({'cursor':'pointer', 'color':'#33698b'});
});

